script: |
  super -f text -I q7357.spq | sort > q7357.out

inputs:
  - name: q7357.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE col0 + + - col1 NOT BETWEEN 54 AND ( - col1 * col2 + 65 );
  - name: tab1

outputs:
  - name: q7357.out
    data: |
      51	14	96
      85	5	59
      91	47	68
